import React, { useState } from 'react';
import { NavLink } from 'react-router-dom';
import { ChevronDown, Sparkles, TrendingUp, Car, Smartphone, BarChart, Globe, Package } from 'lucide-react';

const ModernNavbar = () => {
  const [activeDropdown, setActiveDropdown] = useState(null);

  const navItems = [
    { 
      name: 'Home', 
      path: '/',
      icon: <Sparkles className="h-4 w-4" />
    },
    { 
      name: 'Cars', 
      path: '/category/cars',
      icon: <Car className="h-4 w-4" />,
      submenu: [
        { name: 'Electric Cars', path: '/category/electric-cars' },
        { name: 'Luxury Cars', path: '/category/luxury-cars' },
        { name: 'Used Cars', path: '/category/used-cars' },
        { name: 'Classic Cars', path: '/category/classic-cars' }
      ]
    },
    { 
      name: 'Electronics', 
      path: '/electronics',
      icon: <Smartphone className="h-4 w-4" />,
      submenu: [
        { name: 'Smartphones', path: '/category/smartphones' },
        { name: 'Laptops', path: '/category/laptops' },
        { name: 'Gaming', path: '/category/gaming' },
        { name: 'Home Electronics', path: '/category/home-electronics' }
      ]
    },
    { 
      name: 'Market Analysis', 
      path: '/market-dashboard',
      icon: <BarChart className="h-4 w-4" />
    },
    { 
      name: 'Global Payments', 
      path: '/global-payments',
      icon: <Globe className="h-4 w-4" />,
      highlight: true
    },
    { 
      name: 'Auto Parts', 
      path: '/automotive-parts',
      icon: <Package className="h-4 w-4" />
    },
    { 
      name: 'AI Tools', 
      path: '/seo-analyzer',
      icon: <TrendingUp className="h-4 w-4" />
    }
  ];

  return (
    <nav className="bg-white border-b border-gray-200 shadow-sm">
      <div className="max-w-7xl mx-auto px-4">
        <div className="flex items-center justify-between">
          {/* Desktop Navigation */}
          <div className="hidden lg:flex items-center space-x-1">
            {navItems.map((item) => (
              <div key={item.name} className="relative group">
                <NavLink
                  to={item.path}
                  className={({ isActive }) =>
                    `flex items-center px-4 py-3 text-sm font-medium transition-all ${
                      isActive || item.highlight
                        ? item.highlight
                          ? 'bg-gradient-to-r from-blue-600 to-purple-600 text-white rounded-lg'
                          : 'text-blue-600 border-b-2 border-blue-600'
                        : 'text-gray-700 hover:text-blue-600 hover:bg-gray-50 rounded-lg'
                    }`
                  }
                  onMouseEnter={() => setActiveDropdown(item.name)}
                  onMouseLeave={() => setActiveDropdown(null)}
                >
                  <span className="mr-2">{item.icon}</span>
                  {item.name}
                  {item.submenu && <ChevronDown className="ml-1 h-4 w-4" />}
                </NavLink>

                {/* Dropdown Menu */}
                {item.submenu && activeDropdown === item.name && (
                  <div 
                    className="absolute left-0 mt-2 w-56 bg-white rounded-xl shadow-2xl border border-gray-200 py-2 z-50"
                    onMouseEnter={() => setActiveDropdown(item.name)}
                    onMouseLeave={() => setActiveDropdown(null)}
                  >
                    {item.submenu.map((subItem) => (
                      <NavLink
                        key={subItem.name}
                        to={subItem.path}
                        className="block px-4 py-3 text-sm text-gray-700 hover:bg-blue-50 hover:text-blue-600 transition-all"
                        onClick={() => setActiveDropdown(null)}
                      >
                        {subItem.name}
                      </NavLink>
                    ))}
                  </div>
                )}
              </div>
            ))}
          </div>

          {/* Live Market Stats */}
          <div className="flex items-center space-x-6 text-sm">
            <div className="flex items-center space-x-2">
              <div className="w-2 h-2 bg-green-500 rounded-full animate-pulse"></div>
              <span className="font-medium text-gray-700">Live Market</span>
            </div>
            <div className="hidden lg:flex items-center space-x-4">
              <div className="text-right">
                <div className="text-green-600 font-bold">+2.1%</div>
                <div className="text-xs text-gray-500">Cars Index</div>
              </div>
              <div className="text-right">
                <div className="text-green-600 font-bold">+1.5%</div>
                <div className="text-xs text-gray-500">Electronics</div>
              </div>
              <div className="text-right">
                <div className="text-green-600 font-bold">+20%</div>
                <div className="text-xs text-gray-500">EV Demand</div>
              </div>
            </div>
          </div>
        </div>
      </div>
    </nav>
  );
};

export default ModernNavbar;
